CDBG allows for funding 16 different types of project: 
1.	Community Planning;
2.	Comprehensive Project (mix of two or more of the other categories; HCR has had none since PY 2008);
3.	Economic Development;
4.	Home Ownership;
5.	Housing Rehab;
6.	Imminent Threat;
7.	Innovative Projects (funded only for PY 2010);
8.	Mobile Home;
9.	New Construction (current CDBG guidelines do not allow for new construction; last HCR project was in PY 2006);
10.	Public Facilities;
11.	Public Service (as of PY 2001, HCR does not fund public service projects though eligible under the CDBG guidelines);
12.	Public Sewer;
13.	Public Water;
14.	Small Business;
15.	Technical Assistance;
16.	Wells & Septics.

The Thruway classification of the vehicles.
2L = UNDER 7 feet 6 inches in height, 2 axles;
3L = UNDER 7 feet 6 inches in height, 3 axles;
4L = UNDER 7 feet 6 inches in height, 4 or more axles;
2H = 7 feet 6 inches OR GREATER in height, 2 axles;
3H = 7 feet 6 inches OR GREATER in height, 3 axles;
4H = 7 feet 6 inches OR GREATER in height, 4 axles;
5H = 7 feet 6 inches OR GREATER in height, 5 axles;
6H = 7 feet 6 inches OR GREATER in height, 6 axles;
7H = 7 feet 6 inches OR GREATER in height, 7 or more axles

Group classification of exemption according to property type and/or owner; the types are defined as:
A – Residential, other than multiple dwellings;
B – New York State government;
C – Municipal governments;
D – U.S., foreign governments, interstate agencies;
E – Private community service and social organizations;
F – Industrial, commercial and public service;
G – Multiple dwellings and urban renewal;
H – Agricultural and forest.

HW - State Superfund Program;
BCP - Brownfield Cleanup Program;
VCP - Voluntary Cleanup Program;
ERP - Environmental Restoration Program;
RCRA – Hazardous Waste Management Program.

NYSDEC Region where the site is located:
Region 1: (Long Island) Nassau and Suffolk
counties;
Region 2: (New York City) Brooklyn, Bronx, Manhattan, Queens and Staten Island;
Region 3: (Lower Hudson Valley) Dutchess, Orange, Putnam, Rockland, Sullivan, Ulster and Westchester counties;
Region 4: (Capital Region/Northern Catskills) Albany, Columbia, Delaware, Greene, Montgomery, Otsego, Rensselaer, Schenectady and Schoharie counties;
Region 5: (Eastern Adirondacks/Lake Champlain) Clinton, Essex, Franklin, Fulton, Hamilton, Saratoga, Warren and Washington counties;
Region 6: (Western Adirondacks/Eastern Lake Ontario) Herkimer, Jefferson, Lewis, Oneida and St. Lawrence counties;
Region 7: (Central New York) Broome, Cayuga, Chenango, Cortland, Madison, Onondaga, Oswego, Tioga and Tompkins counties;
Region 8: (Western Finger Lakes) Chemung, Genesee, Livingston, Monroe, Ontario, Orleans, Schuyler, Seneca, Steuben, Wayne and Yates counties;
Region 9: (Western New York) Allegany, Chautauqua, Cattaraugus, Erie, Niagara and Wyoming counties.

Alpha-numeric code that identifies the site class or status:
02 - The disposal of hazardous waste represents a significant threat to the environment or to health;
03 - Contamination does not presently constitute a significant threat the environment or to health;
04 - The site has been properly closed but that requires continued site management;
05 - No further action required;
A - Active;
C - Completed;
P - Sites where preliminary information indicates that a site may have contamination;
PR - Sites that are, or have been, subject to the requirements of the RCRA;
N - No further action.
